class QPSInference(Handler):
    def __init__(self):
        cfg = Config()
        self._service_host = cfg.get_service_host()
        self.stacked_model = None
        self.SERVICE = SimpleNamespace(**model_config['SERVICE'])
        self.DATA = SimpleNamespace(**model_config['DATA'])
        self.PREP = SimpleNamespace(**model_config['PREPROCESSING'])

    # @concurrent.process(timeout=30) # not work with
    def run(self, data: SimpleNamespace):
        company = data.company
        target = data.target
        result_type = data.result_type
        # client = model_client.QPSModelClient(self.SERVICE.host,
        #                                      self.SERVICE.company,
        #                                      self.SERVICE.target,
        #                                      self.SERVICE.result_type)
        output = {}

        ## Load model
        try:
            # model_info = client.get_best_model()
            # print(f'model_id: {model_info.id}')
            # output['model_id'] = model_info.id
            # self.stacked_model = dill.loads(client.download_model(model_info.id))
            ## local model
            with open('../../temp_data/stacked_model.pkl', 'rb') as f:
                self.stacked_model = dill.load(f)
        except grpc.RpcError as e:
            output['error'] = {'message': e.details()}
            print(f'output: {output}')
            return output

        ## Create summary data & save
        try:
            inf_temp_df = pd.DataFrame(data.x)
            inf_summ_df = Summary(self.DATA.raw_id, self.DATA.process_order,
                                  self.DATA.raw_time).\
                create_summary_data(inf_temp_df)
            inf_summ_df.rename(columns={self.DATA.raw_id: self.DATA.id,
                                        self.DATA.raw_time: self.DATA.time},
                               inplace=True)
            SummaryDB().save_data(inf_summ_df)
            inf_df = inf_summ_df.loc[:, self.stacked_model.variables]
        except Exception as e:
            output['error'] = make_error_msg(str(e), f'Preprocess inference data: {traceback.format_exc()}')
            return output

        # predict
        try:
            y_hat = self.predict_with_model(inf_df)
        except Exception as e:
            output['error'] = make_error_msg(str(e), f'Predict : {traceback.format_exc()}')
            return output

        # contribution
        try:
            contribution = self.get_contribution(inf_df)
        except Exception as e:
            output['error'] = make_error_msg(str(e), f'Getting contribution : {traceback.format_exc()}')
            return output


        output['y_hat'] = y_hat
        output['contribution'] = contribution

        return output


    def predict_with_model(self, X: pd.DataFrame) -> float:
        """
        실제 앙상블 모델을 통해 yhat을 구하기 위한 과정
        :param X:
        :return:
        """
        sub_yhats = []
        for sub_model in self.stacked_model.sub_models.values():
            sub_yhat = sub_model.model.predict(X)
            sub_yhats.append(sub_yhat)
        new_X = pd.DataFrame({str(i): yhat for i, yhat in enumerate(chain(*sub_yhats))},
                             index=[0])
        final_yhat = self.stacked_model.meta_model.model.predict(new_X)[0]
        return final_yhat




    def get_contribution(self, X: pd.DataFrame):
        # explainer = shap.Explainer(self.predict_with_model_for_contribution, X)
        explainer = self.stacked_model.explainer
        contribution_df = pd.Series(abs(explainer(X)[0].values),
                              index=X.columns)
        contribution_df = contribution_df/sum(contribution_df)
        contribution_df = contribution_df[contribution_df>10E-5].sort_values(ascending=False)
        contribution = {k: float(v) for k, v in zip(contribution_df.index, contribution_df.values)}
        return contribution






